const FilterPanel = (props) => {
  const { values } = props;
  return (
    <div>
      {values.map((value, index) => {
        return (
          <div className="filterPanel">
            <switch></switch>
            {value}
          </div>
        );
      })}
    </div>
  );
};

export default FilterPanel;
